webpackJsonp([0x9eca47f0bb53],{7355:function(e,t){e.exports={data:{post:{html:'<p><img alt="crackberry.jpg" src="http://www.papascott.de/wordpress/wp-content/uploads/2005/06/crackberry.jpg" width="100" height="133" align="right" /> I am important. I now have a <a href="http://www.blackberry.com/">Blackberry</a> <a href="http://www.blackberry.net/ap/products/handhelds/blackberry7230.shtml">7230</a>.</p>\n<p>Actually, it\'s a hand-me-down, so I\'m actually not all that important. (No, it is not Nico\'s famous <a href="http://lumma.de/eintrag.php?id=1684">Blackberry with wings</a>.) </p>\n<p>At least I now have cell reception at home (Vodafone instead of E-Plus), which is convenient. This is the "No Messages" screen. My favorite command is "Delete Prior" which, if done correctly, actually deletes all.</p>',fields:{title:"Blackberry",date:"16 Jun 2005",url:"https://papascott.de/2005-06-16-blackberry/"}}},pathContext:{slug:"/2005-06-16-blackberry/",prev:{fields:{title:"Terminal Panic",date:"14 Jun 2005",slug:"/2005-06-14-terminal-panic/"}},next:{fields:{title:"Your Blog and Your Career",date:"18 Jun 2005",slug:"/2005-06-18-your-blog-and-your-career/"}}}}}});
